import React from 'react';
import { NavigationBar } from './layout';
import './assets/Styles/app.scss'

const App = () => {
  return (
    <div className='App'>
      <NavigationBar />
      <p style={pageStyle}>Chuj</p>
    </div>
  )
}

const pageStyle = {
  height: "2000px",
  fontSize: "150px"
};

export default App;
